import Header from '../components/Header';

const LayoutStyle = {
    margin: 20,
    padding: 20,
}

const Layout = () => {
    return (
        <div style={LayoutStyle}>
            <Header />
            <main>
                { children }
            </main>
        </div>
    );
}

export default Layout;
